*     9(1): - pe4 s
*     9(2): + pe9 w-plus
      call smffv(lextrn,lextrn,lepinw,ew4,ew3,amsq,amcq,cwsq,
     &           ce4,ce3,ps4,ps3,ep9,lt9,av9)

      call smconf(lt6,lt7,2,1,ew7,av6,av7,lt10,av10)
      call smconv(lt8,lt10,3,2,ew8,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,5,ew9,av9,av11,lt,av)

      sym = + 1.0d0
      aprop         = sym/aprop

      indexg(1) = 4
      indexg(2) = 3
      indexg(3) = 6
      indexg(4) = 5
      indexg(5) = 1
      indexg(6) = 2

      call ampord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 2
      cwgt(0) = 1.d0
      cwgt(1) = 0.d0
      do 500 ic = 0 , ncbase-1
      do 500 ih = 0 , lag-1
         atmp       =  cwgt(ic)*agcwrk(ih)*aprop
         agc(ih,ic) = agc(ih,ic) + colmbf*atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

      return
      end
